          <img className="circle-img" src={props.imgURL} alt="avatar_img"/>


        </div>
        <div className="bottom">
          <p className="info">{props.phone}</p>
          <p className="info">{props.email}</p>
        </div>
      </div>
      </div>)
}
export default contacts;

